import React, { useContext } from 'react'
import { AuthContext } from '../AuthContex'

function User() {
  const authContex = useContext(AuthContext);
  const handleOut = () => { authContex.logout() }
  return (
    <div>
      <button onClick={handleOut}>LOGOUT</button>
      <p>welcome {authContex.auth.data.name + " " + authContex.auth.data.prenom}</p>
      {authContex.auth.prof && <div className='btn btn-light'><a href=''>Click to login</a></div>
      }    </div>
  )
}

export default User
